import React, { useContext } from "react";
import { Select } from "antd";
import { UserContext } from "../../Context/UserContext";

const SelectRick: React.FC = () => {
  const userContext = useContext(UserContext);

  const handleChange = (value: string) => {
    userContext?.handleSelect(value);
  };

  return (
    <Select
      defaultValue="Status"
      style={{ width: 200 }}
      onChange={handleChange}
      options={[
        {
          label: "Status",
          options: [
            { label: "Alive", value: "status-alive" },
            { label: "Dead", value: "status-dead" },
            { label: "Unknown", value: "status-unknown" },
          ],
        },
        {
          label: "Gender",
          options: [
            { label: "Male", value: "gender-male" },
            { label: "Female", value: "gender-female" },
            { label: "Genderless", value: "gender-genderless" },
            { label: "Unknown", value: "gender-unknown" },
          ],
        },
      ]}
    />
  );
};

export default SelectRick;
